    <h2 id="hasil" style="color:red; margin:0px 0px; text-align: center;"><span id="open-modal2">SOLANA</span> <span id="open-modal">CHECKER</span> PRICE</h2> 

    <!-- Modal UIKIT -->
    <div id="my-modal" class="uk-modal-full" uk-modal>
        <div class="uk-modal-dialog">
            <button class="uk-modal-close-full uk-close-large" type="button" uk-close></button>
            <div class="uk-modal-header">
                <h2 class="uk-modal-title">:: SETTING DEX CHECKER</h2>
               
            </div>
            <div class="uk-modal-body">
                <form>
                    <label for="modal-kiri">Modal Kiri:</label>
                    <input type="text" id="modal-kiri" class="uk-input" value="200">

                    <label for="modal-kanan">Modal Kanan:</label>
                    <input type="text" id="modal-kanan" class="uk-input" value="150">

                    <label for="jeda-time">Jeda Time:</label>
                    <input type="text" id="jeda-time" value="350" class="uk-input">

                    <label for="sc-address">SC Address:</label>
                    <input type="text" id="sc-addresspair" value="Es9vMFrzaCERmJfrF4H2FYD4KCoNkY11McCe8BenwNYB" class="uk-input">

                    <label for="des-pair">Des Pair:</label>
                    <input type="text" id="des-pair" value="6" class="uk-input">

                    <label for="symbo-pair">Symbo Pair:</label>
                    <input type="text" id="symbo-pair" value="USDT" class="uk-input">

                    <label for="pnl">PNL:</label>
                    <input type="text" id="pnl" value="1.5" class="uk-input">

                    <button type="button" id="save-button" class="uk-button uk-button-primary">Simpan</button>
                </form>
            </div>
        </div>
    </div>

        <!-- Modal UIKIT -->
        <div id="my-modal2" class="uk-modal-full" uk-modal>
            <div class="uk-modal-dialog">
                <button class="uk-modal-close-full uk-close-large" type="button" uk-close></button>
                <div class="uk-modal-header">
                    <h2 class="uk-modal-title">:: SETTING MODAL</h2>
                   
                </div>
                <div class="uk-modal-body">
                    <form>                      
                        <label for="modal-kiri">API GATE:</label>
                        <input type="text" id="apiGate" class="uk-input" value="0453752e6863401c19845c7f571f15d0">
    
                        <label for="modal-kanan">SECRET GATE:</label>
                        <input type="text" id="secretGate" class="uk-input" value="b3afa15c91b6877f06f8b94de369c871a8d52e198ba8c25e0cec735d8dbd8610">
    
                        <label for="modal-kiri">WALLET SOL:</label>
                        <input type="text" id="walletSOL" class="uk-input" value="">
    
                        <label for="modal-kanan">MODAL AWAL:</label>
                        <input type="text" id="modalAwal" class="uk-input" value="">
    
                        <button type="button" id="saveModal" class="uk-button uk-button-primary">Simpan</button>
                    </form>
                </div>
            </div>
        </div>
<!-- Button untuk memulai SCAN -->

<div class="uk-container uk-margin-top">
    <form>
      <div class="uk-margin">
        <div class="uk-grid-small uk-child-width-1-6" uk-grid>
            <div>
                <label class="uk-form-label" >MODAL AWAL : </label>
                <span class="uk-label uk-label-primary" id="LmodalAwal">?</span>
            </div>
            <div>
                <label class="uk-form-label" >CEX : </label>
                <label class="uk-label uk-label-warning" id="LCEXUSDT" >?</label>
            </div>
            <div>
                <label class="uk-form-label" >DEX : </label>
                <label class="uk-label uk-label-warning" id="LDEXUSDT" >?</label>
            </div>
            <div>
                <label class="uk-form-label" >TOTAL : </label>
                <span class="uk-label uk-label-success" id="LtotalUSDT">?</span>
              </div>

              <div>
                <button class="uk-button uk-button-secondary" type="button" id="calculateButton" style="display: none;">CEK ASET</button>
            </div>
              <div> 
                <div>
                    <label class="uk-form-label" >BEFORE: </label>
                    <span class="uk-label uk-label-primary" id="LpnlBefore">?</span>
                </div>
                <div>
                    <label class="uk-form-label" >AFTER: </label>
                    <label class="uk-label uk-label-danger" id="Lpnl" for="">xxx</label>
                </div>                 
              </div>
              
          </div>
          <hr/>
        <div class="uk-grid-small uk-child-width-1-4" uk-grid>
          <div>
            <label class="uk-form-label" for="mkiri">MODAL KIRI</label>
            <div class="uk-margin uk-form-controls">
              <input class="uk-input" type="number" id="mkiri" name="input1" readonly>
            </div>
          </div>
          <div>
            <label class="uk-form-label" for="mkanan">MODAL KANAN</label>
            <div class="uk-margin uk-form-controls">
              <input class="uk-input" type="number" id="mkanan" name="input1" readonly>
            </div>
          </div>
          <div>
            <label class="uk-label uk-label-warning" for="mkanan">JEDA</label>
            <div class="uk-margin uk-form-controls">
              <input class="uk-input" type="number" id="mjeda" name="input1" readonly >
            </div>
          </div>
          <div>
            <label class="uk-label uk-label-primary" for="mkanan">PNL</label>
            <div class="uk-margin uk-form-controls">
              <input class="uk-input" type="number" id="mpnl" name="input1" readonly>
            </div>
          </div>
        </div>

      </div>
  
      <div class="uk-margin ">
        <div class="uk-margin uk-flex-right uk-form-controls" style=" text-align: right; ">
             <label style="display: none;"><input class="uk-checkbox" checked type="checkbox" id="GATE"> GATE </label>
            <!-- <label><input class="uk-checkbox" type="checkbox"  id="KUCOIN"> KUCOIN</label>
            <label><input class="uk-checkbox" type="checkbox"  id="BYBIT"> BYBIT</label>
            <label><input class="uk-checkbox" type="checkbox"  id="MEXC"> MEXC</label>  -->

            <button class="uk-button uk-button-danger" id="refresh">REFRESH</button>

          <button class="uk-button uk-button-primary uk-margin-left uk-flex-last" type="button" id="startSCAN">START SCAN</button>
        </div>
        
      </div>
  
    </form>
